import './App.css';
import axios from 'axios';
import React, {useState} from "react";
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";
import NewOrder from './NewOrder';
import AllOrders from './AllOrders';
import EditOrder from './EditOrder';
import ShopItems from './ShopItems';

function App() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [emailError, setEmailError] = useState('');
  const [passError, setPassError] = useState('');
  const [isLoggedIn, setIsLoggedIn] = useState(false);
  const [currentUser, setCurrentUser] = useState('');

  const [selectedItems, setSelectedItems] = useState([]);
  const [selectedSupermarket, setSelectedSupermarket] = useState('');
  const [orderId, setOrderId] = useState('');


  // const navigate = useNavigate();

  const handleSearch = async () => {
    try {
      const response = await axios.post('http://localhost:8080/api/validate', {
        userEmail: email, userPassword: password,
      });
      if(response.data.message === 'Successful login'){
        console.log('User validated');
        setIsLoggedIn(true);
      }
      else{
        setPassError('Invalid email or password');
        setEmailError('Invalid email or password');
      }
    } catch (err){
      console.error(err.response?.data?.message || 'Error validating');
    }
  };


  const onButtonClick = () => {
    setEmailError('');
    setPassError('');
   

      //email and password validation
    if('' === email){
      setEmailError('Please enter your email');
      return;
    }

    if (!/^[\w-\.]+@([\w-]+\.)+[\w-]{2,4}$/.test(email)) {
      setEmailError('Please enter a valid email');
      return;
    }
      
    if ('' === password) {
      setPassError('Please enter a password');
      return;
    }

      handleSearch(email, password);
      
      if(passError !== '' || emailError !== ''){
        setIsLoggedIn(true);
      }
      else{
        return;
      }
        //add extra validation to check if email and password are stored for users
        //also check that password matches email
    } 

  return(
    <Router>
      {isLoggedIn ? (
        <>
          <ul className='navBar'>
            <li><Link to="/NewOrder">+</Link></li>
            <li><Link to="/AllOrders"> View Orders</Link></li>
          </ul>
          <Routes>
            <Route path="/NewOrder" element={<NewOrder setSelectedSupermarket={setSelectedSupermarket} setOrderId={setOrderId} />} />
            <Route path="/AllOrders" element={<AllOrders />} />
            <Route path="/EditOrder" element={<EditOrder selectedItems={selectedItems} selectedSupermarket={selectedSupermarket} orderId={orderId} />} />
            <Route path='/ShopItems' element={<ShopItems selectedItems={selectedItems} setSelectedItems={setSelectedItems} />} />
          </Routes>
        </>
        
      ) : (
        <div className='main'>
              <div className='title'>
                  <div>Login</div>
              </div>
              <br/>
              <div className={'inputContainer'}>
              <input
                value={email}
                placeholder="Enter your email here"
                onChange={(ev) => setEmail(ev.target.value)}
                className={'inputBox'}
              />
              <label className="errorLabel">{emailError}</label>
            </div>
              <br/>
              <div className={'inputContainer'}>
                  <input
                      value={password}
                      type="password"
                      placeholder='Enter your password'
                      onChange={(ev) => setPassword(ev.target.value)}
                      className={'inputBox'}
                  />
                  <label className='errorLabel'>{passError}</label>
              </div>
              <br/>
              <div className={'inputContainer'}>
                  <input className={'inputButton'}
                      type = "button"
                      onClick={onButtonClick}
                      value={'Log in'}
                  />
              </div>
            </div>
          )}
    </Router>   
  );
}

export default App;
